    fn _doit(&self, dry_run: bool) -> Result<Result<(), DoitError>, Option<InvalidOptionsError>> {
        let mut err = InvalidOptionsError::new();
        let mut call_result: Result<(), DoitError> = Ok(());
        let mut err_opt: Option<InvalidOptionsError> = None;
        match self.opt.subcommand() {
            ("operations", Some(opt)) => {
                match opt.subcommand() {
                    ("cancel", Some(opt)) => {
                        call_result = self._operations_cancel(opt, dry_run, &mut err);
                    },
                    ("delete", Some(opt)) => {
                        call_result = self._operations_delete(opt, dry_run, &mut err);
                    },
                    ("get", Some(opt)) => {
                        call_result = self._operations_get(opt, dry_run, &mut err);
                    },
                    ("list", Some(opt)) => {
                        call_result = self._operations_list(opt, dry_run, &mut err);
                    },
                    _ => {
                        err.issues.push(CLIError::MissingMethodError("operations".to_string()));
                        writeln!(io::stderr(), "{}\n", opt.usage()).ok();
                    }
                }
            },
            ("services", Some(opt)) => {
                match opt.subcommand() {
                    ("search", Some(opt)) => {
                        call_result = self._services_search(opt, dry_run, &mut err);
                    },
                    ("tenancy-units-add-project", Some(opt)) => {
                        call_result = self._services_tenancy_units_add_project(opt, dry_run, &mut err);
                    },
                    ("tenancy-units-create", Some(opt)) => {
                        call_result = self._services_tenancy_units_create(opt, dry_run, &mut err);
                    },
                    ("tenancy-units-delete", Some(opt)) => {
                        call_result = self._services_tenancy_units_delete(opt, dry_run, &mut err);
                    },
                    ("tenancy-units-list", Some(opt)) => {
                        call_result = self._services_tenancy_units_list(opt, dry_run, &mut err);
                    },
                    ("tenancy-units-remove-project", Some(opt)) => {
                        call_result = self._services_tenancy_units_remove_project(opt, dry_run, &mut err);
                    },
                    _ => {
                        err.issues.push(CLIError::MissingMethodError("services".to_string()));
                        writeln!(io::stderr(), "{}\n", opt.usage()).ok();
                    }
                }
            },
            _ => {
                err.issues.push(CLIError::MissingCommandError);
                writeln!(io::stderr(), "{}\n", self.opt.usage()).ok();
            }
        }

        if dry_run {
            if err.issues.len() > 0 {
                err_opt = Some(err);
            }
            Err(err_opt)
        } else {
            Ok(call_result)
        }
    }

